import ReactPlayer from "react-player";
import './App.css';

function App() {
  return (
    <div id="App">
      <div id="TopSection">
        <h1 id="CompanyName">energyti.me</h1>
     </div>
     <div id="MiddleSection">
        <ReactPlayer 
          url="https://vimeo.com/514419233"
          height="70vh"
          width="95vw"
          display="flex"
          justify-content="center"
          align-items="center"
          />
     </div>
     <div id="BottomSection">
        <h5 id="CompanyType">501(c)-3</h5>
        <h5 id="CompanyEmail">hi@energyti.me</h5>
     </div>
    </div>
  );
}

export default App;
